import React from "react"

import Testimonial from "./Testimonial"

const Testimonials = () => {
  return (
    <div className='jumbotron'>
      <h1 className='servicesHeading' style={{ textAlign: "center" }}>
        Testimonials
      </h1>
      <Testimonial />
    </div>
  )
}

export default Testimonials
